import React from "react";
import { Button } from '@material-ui/core';

function SaveNewUserBtn(props) {
  return (
    <Button 
        onClick={props.handleFormSubmitSaveNewUser} 
        className="btn btn-primary SaveNewUserBtn">
        SAVE
    </Button>
  );
}

export default SaveNewUserBtn;
